import React from "react";
import logo from "./logo.svg";
import "./App.css";

type PropsType = {};

type StatesType = {};

export default class App extends React.Component<PropsType, StatesType> {
    static defaultProps: PropsType = {};

    constructor(props: PropsType) {
        super(props);

        this.state = {};
    }

    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <div className="temp container">
                        {/* Your content goes here */}
                    </div>
                </header>
            </div>
        );
    }
    async componentDidMount(): Promise<void> {
        try {
            const response = await fetch(
                `http://localhost:3000/api/store_items?companyId=${this.state.companyId}`,
                {
                    method: "GET",
                }
            );
            console.log(response); // Log the response
            const prizes: PrizeItem[] = await response.json();
            console.log(prizes); // Log the prizes
            this.setState({ mPrizeItems: prizes, mFilteredList: prizes });
        } catch (error) {
            console.error(error);
        }
    }
}
